import { createApp } from "vue";
import App from "./App.vue";
import { createRouter, createWebHistory } from "vue-router";
import MainComponent from "./components/main/MainComponent.vue";
import NotFound from "./components/global/NotFound.vue";
import LoginComponent from "./components/login/LoginComponent.vue";
import SignUpComponent from "./components/signup/SignUpComponent.vue";
import axios from "axios";

const router = createRouter({
  history: createWebHistory(),
  routes: [
    { path: "/", component: () => "./components/main/MainComponent.vue" },

    {
      path: "/login-page",
      component: () => "./components/login/LoginComponent.vue",
    },
    {
      path: "/sign-up",
      component: () => "./components/signup/SignUpComponent.vue",
    },
    {
      path: "/:notFound(.*)",
      component: () => "./components/global/NotFound.vue",
    },
  ],
});

const app = createApp(App);
app.use(router);
app.config.globalProperties.axios = axios;
app.mount("#app");
